Description:

Jennica Lynn chats with an XL Girls photographer in this Bonus vid. The photographer, a Brit, says that Jennica, a Swede living in the United Kingdom, has an accent that sounds American-English. That makes Jennica laugh. &quot;Everyone says that. I was taught American-English when I was younger and the British-English hasn't rubbed off on me.&quot;

Intercut during their candid chat are scenes of Jennica in the dressing room. She moisturizes her M-cup hooters, changes into an outfit for an upcoming scene and measures her dangerous curves. Beautiful
